import React from 'react';
import './Register';

function Register() {
    return (
        <fieldset className='register'>
            <h2 className='register__title'>Привет, Андрей!</h2>
            <form className='register__form'>
                <input className='register__input'></input>
                <input className='register__input'></input>
            </form>
        </fieldset>
    );
}

export default Register;
